app.post('/managertourguides/edit/:id', upload.single('image'), async (req, res) => {
    const { name, phone, idCity, description, passions, email, languages } = req.body;
    const convertGender = req.body.gender;
    const convertIsActive = req.body.isActive;
    let gender, isActive;
    if (convertGender === 'Male') {
        gender = true
    }
    else {
        gender = false
    }
    if (convertIsActive === 'True') {
        isActive = true
    }
    else {
        isActive = false
    }

    const ref = await db.collection('travelers').where('uID', '==', req.params.id).get();
    const idData = ref.docs[0].id;
    if (req.file) {
        const imageBase64 = req.file.buffer.toString('base64');
        const image = 'data:image/png;base64,' + imageBase64;
        await db.collection('travelers').doc(idData).update({ picture: image })
    }
    await db.collection('travelers').doc(idData).update({ name, phone, idCity, description, passions, email, languages, isActive, gender })
    res.redirect('/managertourguides')
})
