app.get('/becometourguide', async (req, res) => {
    const snapshotAnswer = await db.collection('questions').get();
    const snapshotTravelers = await db.collection('travelers').where('isActive', '==', false).get();
    const answerData = snapshotAnswer.docs.map(doc => doc.data())
    const travelersData = snapshotTravelers.docs.map(doc => doc.data())
    const becometourguide = travelersData.filter(doc => {
        for (let i in answerData) {
            if (doc.uID === answerData[i].idTraveler)
                return true
        }
        return false;
    })
    res.render('becometourguide', { becometourguide })
})
app.get('/becometourguide/view/:id', async (req, res) => {
    const snapshotAnswer = await db.collection('questions').get();
    const data = snapshotAnswer.docs.map(doc => doc.data())
    const answerData = data.find(doc => doc.idTraveler === req.params.id);
    const answerDetailData = answerData.questions.map(doc => doc);
    res.render('detailanswer', { answerDetailData, id: answerData.idTraveler });
})
app.post('/becometourguide/view/:id', async (req, res) => {
    const ref = await db.collection('travelers').where('uID', '==', req.params.id).get();
    const idData = ref.docs[0].id
    await db.collection('travelers').doc(idData).update({ isActive: true, }, { merge: true })
    res.redirect('/becometourguide')
})


